package com.example.gift_and_go;

import android.content.Context;
import android.database.sqlite.SQLiteDatabase;
import android.database.sqlite.SQLiteOpenHelper;

import java.nio.file.Files;

public class MaBaseSQLite extends SQLiteOpenHelper {

    private final static String CREATE_TABLE_CHASSE = "CREATE TABLE chasse (id INTEGER PRIMARY KEY AUTOINCREMENT, nom TEXT NOT NULL);";
    private final static String CREATE_TABLE_LOCALISATION= "CREATE TABLE localisation (id INTEGER PRIMARY KEY AUTOINCREMENT, latitude DOUBLE NOT NULL, longitude DOUBLE NOT NULL, etat BOOLEAN NOT NULL, image TEXT NOT NULL,idChasse INTEGER,FOREIGN KEY (idChasse) REFERENCES chasse(id));";
    private final static String FIRSTCHASSE= "INSERT INTO chasse (nom) VALUES (\"Chasse Demo\");";
    private final static String FIRSTLOCATION = "INSERT into localisation(latitude,longitude,etat,image,idChasse) VALUES (44.8051384,-0.5911331,0, \"\",1);";
    public MaBaseSQLite(Context context, String name, SQLiteDatabase.CursorFactory factory, int version){
        super(context,name,factory,version);
    }

    public void onCreate(SQLiteDatabase db){
        //On cre la base en excutant la requte de cration
        db.execSQL(CREATE_TABLE_CHASSE);
        db.execSQL(CREATE_TABLE_LOCALISATION);
        db.execSQL(FIRSTCHASSE);
        db.execSQL(FIRSTLOCATION);
    }

    public void onUpgrade(SQLiteDatabase db,int oldVersion, int newVersion){
        db.execSQL("DROP TABLE chasse;");
        db.execSQL("DROP TABLE localisation;");
        onCreate(db);
    }
}
